CREATE DATABASE NeedStation;

create table basic_needs_helper (
	id INT,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	email VARCHAR(50),
	gender VARCHAR(50),
	phone_number VARCHAR(50),
	family_phone_number VARCHAR(50),
	permanent_address VARCHAR(50),
	current_address VARCHAR(50),
	aadhaar_number VARCHAR(50),
	police_verification_statue VARCHAR(50),
	work_category VARCHAR(12),
	years_of_experience INT,
	emergency_contact_name VARCHAR(50),
	emergency_contact_number VARCHAR(50)
);

ALTER TABLE basic_needs_helper MODIFY COLUMN aadhaar_number VARCHAR(50);






